message:
Fix a few bugs

* libbalsa/mailbox_local.c
  (libbalsa_mailbox_local_set_threading): thread messages only if
  there are some; otherwise just set messages-threaded;
* src/balsa-index.c (bndx_scroll_on_open_idle): if the mailbox
  is empty, just show it and return;
  (balsa_index_scroll_on_open): do not special case an empty
  mailbox;
* src/main-window.c (bw_real_open_mbnode_idle_cb),
  (balsa_window_real_open_mbnode): register open mailbox earlier,
  to avoid a race with an idle handler;
  (bw_real_open_mbnode_thread): add a warning.

Licenses: Add copyrights and SPDX license header to src/*.{ui,xml,build}

Follow the REUSE specifications to apply licenses https://reuse.software/

https://gitlab.gnome.org/GNOME/devhelp/issues/15

codegen: Use result value of assignment rather than its computation

An inline assignment of an array-length, like

    int j = --i.length;

resulted in a faulty tranformation

    i_length1 = i_length1 - 1;
    j = i_length1 - 1;

Regression of 80d4bf61e0c3100c839f3fdbcb5218996b6afd5f

Fixes https://gitlab.gnome.org/GNOME/vala/issues/895

gl renderer: Make RoundedRect work in gles

Which can't return struct types containing arrays. So let's revert to
the previous version but still send the rect along as a vec4[3];

